import React, {useEffect, useState} from 'react';
import {Link} from 'react-router-dom';

function Tweet() {
    useEffect(()=>{
        fetchItems();
    }, []);

    const [items,setItems]=useState([]);
    const fetchItems= async()=>{
        const data = await fetch('/tweet');
        const items= data.json();
        setItems(items);
    };
    return (
        
        <div>
            {
                items.map(item=>(
                    <div>
                    <p>{item.name}</p>
                    <p>{item.roll}</p>
                    <p>{item.batch}</p>
                    </div>
                ))
            }
        </div>
        
    );
}

export default Tweet;
